import java.util.Arrays;
public class day2{
    public static String passcode(String[] nums){
        String[][] keypad = {
            {"1", "2", "3"}, 
            {"4", "5", "6"}, 
            {"7", "8", "9"}
            };
        int row = 1;
        int column = 1;
        String compiler = "";
        for(int i = 0; i < nums.length; i++){
            String num = nums[i];
            for (int d = 0; d < num.length(); d++){  
            if (num.charAt(i) == 'L' && column > 0){
                column--;
            }
            else if(num.charAt(i) == 'R' && column < 2){
                column++;
            }
            else if(num.charAt(i) == 'U' && row > 0){
                row--;
            }
            else if(num.charAt(i) == 'D' && row < 2){
                row++;
            }
        }
        compiler += keypad[row][column];
        }
        return compiler;
        }
    public static void main(String[] args){
        String[] instructions = {
            "",
            "",
            "",
            ""
        };
        System.out.println(passcode(instructions));
    }
}